import React, { useState, useEffect } from 'react';
import '../css/Rutas.css'; // Asegúrate de crear este archivo CSS

const Rutas = () => {
  const [rutas, setRutas] = useState([]);
  const [currentMonth, setCurrentMonth] = useState(new Date().getMonth());
  const [currentYear, setCurrentYear] = useState(new Date().getFullYear());

  useEffect(() => {
    // Simulación de carga de datos de programación
    const scheduleData = require('../data/september-2025-schedule.json');
    const processedRutas = processScheduleData(scheduleData, currentMonth, currentYear);
    setRutas(processedRutas);
  }, [currentMonth, currentYear]);

  const processScheduleData = (scheduleData, month, year) => {
    const rutasData = [];
    const scheduleDays = scheduleData.days;

    // The keys are 'YYYY-MM-DD'
    Object.keys(scheduleDays).forEach(dateKey => {
        // Splitting the date string is safer against timezone issues.
        const [y, m, d] = dateKey.split('-').map(Number);

        // Month in JS Date is 0-indexed, but here 'm' is 1-indexed.
        if (y === year && (m - 1) === month) {
            const daySchedule = scheduleDays[dateKey];

            // Reconstruct date for formatting
            const date = new Date(Date.UTC(y, m - 1, d));
            const formattedDate = date.toLocaleDateString('es-ES', { timeZone: 'UTC', day: '2-digit', month: '2-digit', year: 'numeric' });

            const processShift = (shift, origen, destino, hora) => {
                if (daySchedule[shift]) {
                    daySchedule[shift].forEach(person => {
                        rutasData.push({
                            CEDULA: person.id,
                            NOMBRE: person.name,
                            FECHA: formattedDate,
                            ORIGEN: origen,
                            DESTINO: destino,
                            HORA: hora,
                        });
                    });
                }
            };

            processShift('morning', 'CASA', 'REDEBAN', '06:00:00');
            processShift('afternoon', 'REDEBAN', 'CASA', '22:00:00');

            if (daySchedule.night) {
                daySchedule.night.forEach(person => {
                    // Ida
                    rutasData.push({
                        CEDULA: person.id,
                        NOMBRE: person.name,
                        FECHA: formattedDate,
                        ORIGEN: 'CASA',
                        DESTINO: 'REDEBAN',
                        HORA: '22:00:00',
                    });

                    // Vuelta (next day)
                    const nextDay = new Date(Date.UTC(y, m - 1, d + 1));
                    const nextDayFormatted = nextDay.toLocaleDateString('es-ES', { timeZone: 'UTC', day: '2-digit', month: '2-digit', year: 'numeric' });
                    rutasData.push({
                        CEDULA: person.id,
                        NOMBRE: person.name,
                        FECHA: nextDayFormatted,
                        ORIGEN: 'REDEBAN',
                        DESTINO: 'CASA',
                        HORA: '06:00:00',
                    });
                });
            }
        }
    });

    return rutasData;
  };

  const handleMonthChange = (increment) => {
    setCurrentMonth(prevMonth => {
      let newMonth = prevMonth + increment;
      let newYear = currentYear;
      if (newMonth > 11) {
        newMonth = 0;
        newYear++;
      } else if (newMonth < 0) {
        newMonth = 11;
        newYear--;
      }
      setCurrentYear(newYear);
      return newMonth;
    });
  };

  return (
    <div className="rutas-container">
      <h2>Gestión de Rutas</h2>
      <div className="month-navigator">
        <button onClick={() => handleMonthChange(-1)}>&lt; Anterior</button>
        <span>{new Date(currentYear, currentMonth).toLocaleString('es-ES', { month: 'long', year: 'numeric' })}</span>
        <button onClick={() => handleMonthChange(1)}>Siguiente &gt;</button>
      </div>
      <div className="table-responsive">
        <table className="rutas-table">
          <thead>
            <tr>
              {/* <th>ÁREA</th> */}
              <th>CÉDULA</th>
              <th>FECHA</th>
              <th>NOMBRE</th>
              <th>ORIGEN</th>
              <th>DESTINO</th>
              <th>HORA</th>
              {/* <th>CORREO</th> */}
            </tr>
          </thead>
          <tbody>
            {rutas.map((ruta, index) => (
              <tr key={index}>
                {/* <td>{ruta.AREA}</td> */}
                <td>{ruta.CEDULA}</td>
                <td>{ruta.FECHA}</td>
                <td>{ruta.NOMBRE}</td>
                <td>{ruta.ORIGEN}</td>
                <td>{ruta.DESTINO}</td>
                <td>{ruta.HORA}</td>
                {/* <td>{ruta.CORREO}</td> */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Rutas;
